import React from 'react'
import { SliderData } from './SliderData'

const ImageSlider = () => {
  return (
    <>
    {SliderData.map((slide, index) => {
        return(
            <img src={slide.imag} alt='' />
        )
    }
    )}
    <div>Images</div>
    </>
  )

}

export default ImageSlider
